    this.formateur = formateur;
  }

  get Id() {
    return this.id;
  }

  get Title() {
    return this.title;
  }

  set Title(title) {
    this.title = title;
  }

  get Formateur() {
    return this.formateur;
  }

  set Formateur(formateur) {
    this.formateur = formateur;
  }

  get Description() {
    return this.description;
  }

  set Description(description) {
    this.description = description;
  }

}
